import React from 'react';
import '../../App.css';

export default function Facilities() {
  return (
    <>
    <h1 id="facilites-title">Our Facilities</h1>
    <div className="wrapperFacilities">
      <img src='images/ramapotenniscourts.jpeg' alt='Tennis Courts - On Serve Tennis' class="facilitiesImage"></img>

      </div>  

      <div className="facilities-text">
        <h2 class="programs-header">Our Facilites</h2>
        <p>On Serve Tennis camps are located at Ramapo College's athletic complex, which includes 12 tennis courts, 400 meter running track, and many
          more amazing features provided by Ramapo College. 
        </p>
    </div>
  </>



  );
}
